import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './css/style.css';
import * as serviceWorker from './serviceWorker';
import ReactPlayer from 'react-player';



const videoElement =(<div class="grid-container">
<div >1</div>
<div >2</div>
<div >3</div>  
<div >4</div>
<div >5</div>
<div >6</div>  
<div >7</div>
<div >8</div>
<div >9</div>  
<div >10</div>
<div >11</div>
<div >12</div>  
</div>);

function videoElement1(props){
  return (
    <div>
      <ReactPlayer
        // url='https://www.youtube.com/watch?v=35lXWvCuM8o'
        url={props.url}
        className='react-player'
        playing
        width='100%'
        height='100%'
      />
    </div>
  );
};

class App extends React.Component {
  render() {
    return (
      <div>
        <ReactPlayer
          url='https://www.youtube.com/watch?v=35lXWvCuM8o'
          className='react-player'
          playing
          width='100%'
          height='100%'
        />
      </div>
    );
  }
}
const a = <videoElement1 url='https://www.youtube.com/watch?v=35lXWvCuM8o'/>
ReactDOM.render(
 a,document.getElementById('root')
);



// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
